'use client'
import { useForm, Controller } from 'react-hook-form'
import { Input, DatePicker, Upload, Button } from 'antd'
import { useState, forwardRef, useImperativeHandle } from 'react'
import { CloseIcon } from '../../../icons'
import { TextInput } from '../../TextInput'

const { TextArea } = Input

const ProjectDetails = forwardRef((props, ref) => {
    const [fileList, setFileList] = useState([])

    const {
        control,
        handleSubmit,
        formState: { errors },
        trigger,
        getValues,
        clearErrors,
        setValue,
    } = useForm({
        defaultValues: {
            projectVision: '',
            estimateTimeline: null,
            budgetRange: '',
        },
    })

    useImperativeHandle(ref, () => ({
        validateForm: async () => {
            const result = await trigger()
            if (result) {
                // Clear all errors when validation passes
                clearErrors()
            }
            return result
        },
        getFormData: () => ({
            ...getValues(),
            files: fileList,
        }),
        setFormData: (data) => {
            if (data.projectVision !== undefined)
                setValue('projectVision', data.projectVision)
            if (data.estimateTimeline !== undefined)
                setValue('estimateTimeline', data.estimateTimeline)
            if (data.budgetRange !== undefined)
                setValue('budgetRange', data.budgetRange)
            if (data.files !== undefined) setFileList(data.files)
        },
    }))

    const onSubmit = (data) => {}

    const handleFileChange = ({ fileList: newFileList }) => {
        setFileList(newFileList)
    }

    const handleFileRemove = (file) => {
        const newFileList = fileList.filter((item) => item.uid !== file.uid)
        setFileList(newFileList)
    }

    const uploadProps = {
        multiple: true,
        fileList,
        onChange: handleFileChange,
        onRemove: handleFileRemove,
        beforeUpload: (file) => {
            const isLt4M = file.size / 1024 / 1024 < 4
            if (!isLt4M) {
                console.error('File must be smaller than 4MB!')
                return false
            }

            // Check file type
            const isValidType = [
                'image/jpeg',
                'image/png',
                'image/gif',
                'image/webp',
                'application/pdf',
            ].includes(file.type)
            if (!isValidType) {
                console.error('Only image files and PDFs are allowed!')
                return false
            }

            return false
        },
        showUploadList: false,
    }

    return (
        <form
            onSubmit={handleSubmit(onSubmit)}
            className="space-y-6 md:space-y-12"
        >
            {/* Project Vision Field */}
            <TextInput
                name="projectVision"
                control={control}
                label="Tell us about your project vision"
                placeholder="Share your design ideas or preferences"
                type="textarea"
                rows={6}
                rules={{
                    required: 'Please share your project vision',
                    minLength: {
                        value: 20,
                        message:
                            'Please provide more details (at least 20 characters)',
                    },
                }}
                onChange={(e) => {
                    setTimeout(() => trigger('projectVision'), 0)
                }}
            />

            {/* File Upload Field */}
            <div className="space-y-4">
                <label className="block text-base text-nomadory-primary mb-4">
                    Upload inspiration/sketches{' '}
                    <span className="text-gray-500 font-normal">(max 4MB)</span>
                </label>
                <Upload.Dragger
                    {...uploadProps}
                    className="nomadory-project-file-upload"
                >
                    <div>Add files</div>
                </Upload.Dragger>

                <div className="mt-4">
                    {fileList.length > 0 && (
                        <div className="flex flex-wrap gap-1">
                            {fileList.map((file) => (
                                <div
                                    key={file.uid}
                                    className="flex items-center justify-between gap-3 rounded-full border border-nomadory-primary/30 py-1 px-2"
                                >
                                    <span
                                        title={file.name}
                                        className="text-base max-w-[100px] truncate"
                                    >
                                        {file.name}
                                    </span>
                                    <button
                                        type="button"
                                        onClick={() => handleFileRemove(file)}
                                    >
                                        <svg
                                            width="16"
                                            height="16"
                                            viewBox="0 0 16 16"
                                            fill="none"
                                            xmlns="http://www.w3.org/2000/svg"
                                        >
                                            <circle
                                                cx="8"
                                                cy="8"
                                                r="8"
                                                fill="#221E1D"
                                                fillOpacity="0.3"
                                            />
                                            <path
                                                d="M4.53576 4.53553L11.6068 11.6066M11.6068 4.53553L4.53576 11.6066"
                                                stroke="#FAFAF8"
                                            />
                                        </svg>
                                    </button>
                                </div>
                            ))}
                        </div>
                    )}
                </div>
            </div>

            {/* Timeline and Budget Fields */}
            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                {/* Estimated delivery date */}
                <div className="space-y-4">
                    <label className="block text-base text-nomadory-primary mb-4">
                        Estimated delivery date
                    </label>
                    <Controller
                        name="estimateTimeline"
                        control={control}
                        render={({ field }) => (
                            <DatePicker
                                {...field}
                                placeholder="12/07/2025"
                                size="large"
                                className="w-full nomadory-date-picker text-sm"
                                format="MM/DD/YYYY"
                                disabledDate={(current) => {
                                    return (
                                        current &&
                                        current <
                                            new Date().setHours(0, 0, 0, 0)
                                    )
                                }}
                                suffixIcon={
                                    <svg
                                        width="20"
                                        height="20"
                                        viewBox="0 0 34 34"
                                        fill="none"
                                        xmlns="http://www.w3.org/2000/svg"
                                        xmlnsXlink="http://www.w3.org/1999/xlink"
                                    >
                                        <mask
                                            id="mask0_1818_1196"
                                            style={{ maskType: 'alpha' }}
                                            maskUnits="userSpaceOnUse"
                                            x="0"
                                            y="0"
                                            width="34"
                                            height="34"
                                        >
                                            <rect
                                                width="34"
                                                height="34"
                                                fill="url(#pattern0_1818_1196)"
                                            />
                                        </mask>
                                        <g mask="url(#mask0_1818_1196)">
                                            <rect
                                                width="34"
                                                height="34"
                                                fill="#221E1D"
                                            />
                                        </g>
                                        <defs>
                                            <pattern
                                                id="pattern0_1818_1196"
                                                patternContentUnits="objectBoundingBox"
                                                width="1"
                                                height="1"
                                            >
                                                <use
                                                    xlinkHref="#image0_1818_1196"
                                                    transform="scale(0.0005)"
                                                />
                                            </pattern>
                                            <image
                                                id="image0_1818_1196"
                                                width="2000"
                                                height="2000"
                                                preserveAspectRatio="none"
                                                xlinkHref="data:image/png;base64,"
                                            />
                                        </defs>
                                    </svg>
                                }
                            />
                        )}
                    />
                </div>

                {/* Budget Range */}
                <TextInput
                    name="budgetRange"
                    control={control}
                    label="Budget range ($)"
                    placeholder="Approximate Value"
                    rules={{
                        pattern: {
                            value: /^[\d,\-\s$]*$/,
                            message: 'Please enter a valid budget range',
                        },
                    }}
                    onChange={(e) => {
                        setTimeout(() => trigger('budgetRange'), 0)
                    }}
                />
            </div>
        </form>
    )
})

ProjectDetails.displayName = 'ProjectDetails'

export { ProjectDetails }
